import React,{Component} from 'react';
import SearchBox from './SearchBox';
import CardList from './CardList';
import {robots} from './robots';

const App = ()=> {
	class App extends Component{
		constructor(){
			super()
			this.state = {
				robots: robots,
				searchfield : ''
			}
		}
		render(){
			return(
				<div className='tc'>
					<h1 class ='bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5 '>BotBuddies</h1>
					<SearchBox />
					<CardList robots  = {robots} />
				</div>
			);
		}
	}
}
export default App;
